import { useEffect } from 'react';
//var now=new  Date().toLocaleString();
var now=1;
const linkStyle = {
  marginRight: 15
};
useEffect(()=>{
  setInterval (()=>{now+=1},1000)
},[])
const Header = () => (
  <div>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
        </Link>
    <Link href="/">
<a style={linkStyle}>{now}</a>
        </Link>
  </div>

);

export default Header;
